module.exports = "<h1>About the assignment</h1>\n<hr/>\n\n<h4>About</h4>\n<p>Solution was developed using Angular 7 with some additional libraries. Data is served via REST API and exposed using <a\n  href=\"https://github.com/typicode/json-server\">json-server</a>. Additional libraries used:</p>\n<ul>\n  <li>Chart.js (to generate charts)</li>\n  <li>Angular material (for consistent material design UI controls)</li>\n  <li>Twitter bootstrap (grid & css styling)</li>\n</ul>\n\n<h4>Installation</h4>\n<ol>\n  <li><strong>npm install / yarn install</strong> in the main directory</li>\n  <li>In additional terminal window run mock backend using <strong>npm run mock-server / yarn run\n    mock-server</strong>. <br/>That should start local development server serving data via REST API. Server should run\n    under http://localhost:3000.\n  </li>\n  <li>In order to start the development version of the application frontend run: <strong>npm run start / yarn run\n    start</strong></li>\n  <li>In order to start the production build run: <strong>npm run start-prod / yarn run start-prod</strong>.</li>\n</ol>\n<strong>Remark:</strong> It's recommended to run production version, because the total app bundle is smaller and everything is working faster, but it's not possible to debug the app easily.\n\n<h4>Assumptions & Remarks</h4>\n<ul>\n  <li>Some further work would be necessary to remove js dependencies that are not needed on production build (Improve\n    tree-shaking).\n  </li>\n  <li>Twitter bootstrap could be replaced with a simpler framework like for example <a href=\"http://getskeleton.com/\">http://getskeleton.com/</a>\n    or simple set of responsive scss mixins.\n  </li>\n  <li>I haven't done any validation on min/max filters and from/to dates. So it's possible to select max that is smaller\n    than min. Needs some further work\n  </li>\n  <li>Due to limited amount of time for the assignment unit testing and e2e testing was not done.</li>\n</ul>\n\n<h4>Feature summary</h4>\n<table class=\"table\">\n  <tr>\n    <td>A graph of provided price time series normalized to 100% at the start date</td>\n    <td>Done. Everything is scaled using first data point's value.</td>\n  </tr>\n  <tr>\n    <td>An easily navigable table of the same time series values as for the graph (columns: date,\n      instrument 1 value, instrument 2 value, ...)\n    </td>\n    <td>Done.</td>\n  </tr>\n  <tr>\n    <td>Two data filters.\n      <ul>\n        <li>with start and end for dates, when applied only the dates satisfying the filter\n          should be shown in the graph and in the table\n        </li>\n        <li>with min and max for values, when applied only the values satisfying the filter\n          should be shown in the graph and in the table\n        </li>\n      </ul>\n    </td>\n    <td><br/>Done.<br/><br/> Done.</td>\n  </tr>\n  <tr>\n    <td>Controls for filtering of time series to be displayed in the graph and shown in the table (i.e.\n      to be able to select only a subset of all instruments)\n    </td>\n    <td>Done. It's possible to select a subset of data in the graph, but that's not reflected in the table. Needs\n      further work.\n    </td>\n  </tr>\n</table>\n"

